import React, { Component } from "react";
import _loadWeather from "../services/weatherService";

class Weather extends Component {
  state = { weather: "1" };

  componentDidMount() {
    return _loadWeather().then(resultingJSON =>
      this.setState({ weather: resultingJSON })
    );
  }
  render() {
    return (
      <div>
        <button onClick={() => console.log(this.state.weather)}>test</button>
        {/* <p>
          <span>{this.state.weather[0].temp}</span>
          <span>{this.state.weather[0].timestamp}</span>
          <span>{this.state.weather[0].description}</span>
        </p> */}
        {this.state.weather.map(x => (
          <p key={x.id}>
            {x.temp} ||
            {x.timestamp} ||
            {x.description}
          </p>
        ))}
      </div>
    );
  }
}

export default Weather;
